description:
В нашем автоцентре Вы можете воспользоваться следующими услугами: 
Срочный выкуп автомобиля любой марки в течении 30-минут, деньги сразу;
Trade-IN (прием автомобиля в зачет стоимости нового или с пробегом);
Выкуп кредитных автомобилей, 
Прием автомобилей на комиссию (помощь в продаже).
Оформление кредита, решение в течении 20 минут после подачи заявки; Срок кредитования от 6 до 96 месяцев, с возможностью как полного, так и частичного досрочного погашения, без штрафов и дополнительных комиссий.
